import { useEffect, useState } from "react";

function Orders() {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    fetch(
      `http://127.0.0.1:8000/api/orders/?user=${localStorage.getItem("user_id")}`
    )
      .then(res => res.json())
      .then(setOrders);
  }, []);

  return (
    <div className="card">
      <h2>Admin Dashboard</h2>

      {orders.map(o => (
        <div key={o.id} className="order-row">
          <span>â‚¹ {o.total}</span>
          <span>{o.created_at}</span>
        </div>
      ))}
    </div>
  );
}

export default Orders;
